local Lua = {}

local Decode = crypt.base64.decode
local WriteFile = writefile
local GetCustomAsset = getcustomasset

local RunService = game:GetService("RunService")

local NewVector2 = Vector2.new
local NewUDim2 = UDim2.new

local Connection

local EncodedAsset = ""

Lua.Load = function(Modules)
    local Menu = Modules.Menu
    local Flags = Menu.Flags

    local Path = Menu.BasePath .. "/Images/QV.png"

    WriteFile(Path, Decode(EncodedAsset))

    local Frame = Menu.Draw("ImageLabel", { Parent = Menu.Overlay, AnchorPoint = NewVector2(0, 0.5), Size = NewUDim2(0, 250, 0, 250), Position = NewUDim2(0.8, 0, 0.5, 0), Image = GetCustomAsset(Path), BackgroundTransparency = 1, BorderSizePixel = 0, Visible = false })

    Connection = RunService.Heartbeat:Connect(function()
        Frame.Visible = Flags["Ragebot Auto Peek"].Value or Flags["Knifebot Auto Peek"].Value
    end)
end

Lua.Unload = function()
    if Connection then
        Connection:Disconnect()

        Connection = nil
    end
end

return Lua
